class MTBCmdMsg_C(object):
    thisown = property(lambda x: x.this.own(), lambda x, v: x.this.own(v), doc="The membership flag")
    __repr__ = _swig_repr
    header = property(_MTBCmdMsgPayload.MTBCmdMsg_C_header_get, _MTBCmdMsgPayload.MTBCmdMsg_C_header_set)
    payload = property(_MTBCmdMsgPayload.MTBCmdMsg_C_payload_get, _MTBCmdMsgPayload.MTBCmdMsg_C_payload_set)
    payloadPointer = property(_MTBCmdMsgPayload.MTBCmdMsg_C_payloadPointer_get, _MTBCmdMsgPayload.MTBCmdMsg_C_payloadPointer_set)
    headerPointer = property(_MTBCmdMsgPayload.MTBCmdMsg_C_headerPointer_get, _MTBCmdMsgPayload.MTBCmdMsg_C_headerPointer_set)

    def recorder(self, timeDiff=0):
        return _MTBCmdMsgPayload.MTBCmdMsg_C_recorder(self, timeDiff)


    def subscribeTo(self, source):
        """subscribe to another message source"""
        from Basilisk.architecture.messaging import MTBCmdMsg
        if type(source) == type(self):
            MTBCmdMsg_C_subscribe(self, source)
        elif type(source) == MTBCmdMsg:
            MTBCmdMsg_cpp_subscribe(self, source)
        elif type(source) == int: #Note that is assumes it is a uint64_t address in memory
            MTBCmdMsg_addr_subscribe(self, source)
        else:
            raise Exception('tried to subscribe MTBCmdMsg to another message type')

    def unsubscribe(self):
        """Unsubscribe to the connected message, noop if no message was connected"""
        MTBCmdMsg_unsubscribe(self)

    def isSubscribedTo(self, source):
        """check if self is subscribed to another message source"""
        from Basilisk.architecture.messaging import MTBCmdMsg
        if type(source) == type(self):
            return (MTBCmdMsg_C_isSubscribedTo(self, source))
        elif type(source) == MTBCmdMsg:
            return (MTBCmdMsg_cpp_isSubscribedTo(self, source))
        elif type(source) == int: #Note that this assumes it is a uint64_t address location in memory
            return (MTBCmdMsg_cpp_isSubscribedToAddr(self, source))
        else:
            return 0


    def init(self, data=None):
        """returns a Msg copy connected to itself"""
        MTBCmdMsg_C_addAuthor(self, self)
        if data:
            MTBCmdMsg_C_write(data, self, -1, 0)
        return self

    def write(self, payload, time=0, moduleID=0):
        """write the message payload.
        The 2nd argument is time in nanoseconds.  It is optional and defaults to 0.
        The 3rd argument is the module ID which defaults to 0.
        """
        MTBCmdMsg_C_addAuthor(self, self)
        MTBCmdMsg_C_write(payload, self, moduleID, time)  # msgs written in Python have 0 module ID
        return self

    def read(self):
        """read the message payload."""
        return MTBCmdMsg_C_read(self)


    def __init__(self):
        _MTBCmdMsgPayload.MTBCmdMsg_C_swiginit(self, _MTBCmdMsgPayload.new_MTBCmdMsg_C())
    __swig_destroy__ = _MTBCmdMsgPayload.delete_MTBCmdMsg_C

